data=""

Counter = 14
Unikat = ''

for i in range(len(data)-14):
    ctyrmistnepole=data[i:(i+14)]

    for j in ctyrmistnepole:
        if not j in Unikat:
            Unikat=Unikat+j

    if ctyrmistnepole ==Unikat:
        print("First marker je:", Counter)
        break
    Unikat = ''
    Counter +=1    
